import ReactDOM from 'react-dom';
import Button from '@material-ui/core/Button';

<ButtonGroup variant="contained" color="primary" aria-label="contained primary button group">
  <Button>One</Button>
  <Button>Two</Button>
  <Button>Three</Button>
</ButtonGroup>
